import React, {Component} from 'react';
import { Link, Route, Router } from 'react-router-dom';
import styled from "styled-components";
import Login from '../Components/Login';
import Signup from '../Components/Signup';
//const axios = require('axios'); 

class Home extends Component {
  render(){
    return (
      <div>
        <Container></Container>;
        <center>
          <h1>오늘의 디저트</h1>
          <Login />
          <button
                style={{
                  width: '200px',
                  height: '30px',
                  margin: '5px',
                  borderRadius: '5px',
                  backgroundColor: 'white'
                }}
                type="submit"
              >
                회원가입
              </button>
              <button
                style={{
                  width: '200px',
                  height: '30px',
                  margin: '5px',
                  borderRadius: '5px',
                  backgroundColor: 'white'
                }}
                type="submit"
              >
                비회원으로 시작
              </button>
        </center>
      </div>
    )
  }
}

const Container = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: 
      url(https://ifh.cc/g/14HzBN.jpg);
  background-size: cover;
  background-position: top;
`;

export default Home;
